<template>
    <div class="relative flex flex-col w-80% mx-auto mt-4">
        <template v-for="(item, index) in list" :key="index">
            <div class="flex border-b border-color-index pb-3 mb-8">
                <img :src="item.icon" alt="" />
                <span class="ml-4 text-4.5 font-bold"> {{ item.title }}</span>
            </div>
            <div class="ml-35 flex flex-wrap text-center">
                <router-link
                    v-for="(d, i) in item.data"
                    :key="i"
                    class="mb-8 w-35"
                    :to="d.url"
                >
                    <span
                        :style="`background-image:url(${d.bg})`"
                        class="inline-block w-16 h-16 text-12 text-white"
                    >
                        <n-icon v-html="d.icon"></n-icon
                    ></span>
                    <p class="text-4">
                        {{ d.name }}
                    </p>
                </router-link>
            </div>
        </template>
    </div>
</template>

